  return (
    <div className='cabecera'>
      <div className='cabecera__header'>
        <h1 className='cabecera__titulo'>loopstudios</h1>
        <Cabecera/>        
      </div>
      <h1 className='cabecera__contenido'>INMERSIVE EXPERIENCES THAT DELIVER</h1>
    </div>
  )
}

export default Cabecera
